import React from "react";
import styles from "./Worker.module.css";
import { ListWrapper } from "./ListWrapper";

export const Worker = (props) => {
  return (
    <>
      <td>{props.name}</td>
      <td>{props.surname}</td>
      <td>{props.gender}</td>
      <td>{props.birthday}</td>
      <td>{props.salary}$</td>
      <td>{props.department}</td>
    </>
  );
};
